import React, { useState } from 'react';
import SignUp from './components/SignUp';
import Login from './components/Login';
import CarList from './components/CarList';
import AddCar from './components/AddCar';
import './styles/App.css';

const App = () => {
    const [userId, setUserId] = useState(null); // Store logged-in user ID

    const handleLogin = (id) => {
        setUserId(id); // Set userId when a user logs in
    };

    return (
        <div>
            <header className="navbar">
                <h1>Car Management App</h1>
                <nav>
                    <a href="#signup">Sign Up</a>
                    <a href="#login">Login</a>
                    <a href="#your-cars">Your Cars</a>
                    <a href="#add-car">Add Car</a>
                </nav>
            </header>

            <main className="content">
                <section id="signup">
                    <h2>Sign Up</h2>
                    <SignUp />
                </section>

                <section id="login">
                    <h2>Login</h2>
                    <Login onLogin={handleLogin} />
                </section>

                <section id="your-cars">
                    <h2>Your Cars</h2>
                    {userId ? (
                        <CarList userId={userId} />
                    ) : (
                        <p>Please log in to view your cars.</p>
                    )}
                </section>

                <section id="add-car">
                    <h2>Add Car</h2>
                    {userId ? (
                        <AddCar userId={userId} />
                    ) : (
                        <p>Please log in to add a car.</p>
                    )}
                </section>
            </main>
        </div>
    );
};

export default App;
